import React from 'react'
import { Button } from 'antd';
import { connect } from 'react-redux'
import request  from '../../dataCal/dataCal'

class Feedback extends React.Component {

  //初始化
  state = {
      "studentID": '' ,
      "studentPassword": '' ,
      "studentMajor": '' ,
  };

  //更新接收信息状态
  componentWillReceiveProps(){
    this.setState({
      studentID: '',
      studentPassword: '',
      studentMajor: '',
    })
  }

  studentDataResult = () =>{
    let res = request(this.props.studentID, this.props.studentPassword);
    this.setState({
      J: res.isAttendJLesson,
      S: res.isAttendSLesson,
      FL: res.totalCreditOfLanguageCourse,
      GC: res.totalCreditOfGeneralCourse,
      PA: res.totalCreditOfPACourse,
      NS: res.ttotalCreditOfNSCourse,
      NC: res.totalCreditOfNCourse,
      CC: res.totalCreditOfCCourse,
      Credit: res.totalCreditOfCourse,
    })
  };

  render() {

    //const { studentID, studentPassword, studentMajor } = this.props;
    return(
        <div>
          <p>你的学号是{this.props.studentID}</p>
          <p>你的专业是{this.props.studentMajor}</p>
          <p>是否已上J类 {this.state.J}</p>
          <p>是否已上通核 {this.state.S}</p>
          <p>你已经修读的外语类总学分 {this.state.FL}</p>
          <p>你已经修读的通识类总学分 {this.state.GC}</p>
          <p>你已经修读的军体类总学分 {this.state.PA}</p>
          <p>你已经修读的自然科学类总学分 {this.state.NS}</p>
          <p>你已经修读的专业选修课程总学分 {this.state.NC}</p>
          <p>你已经修读的专业必修课程总学分 {this.state.CC}</p>
          <p>专业选修课程总学分 {this.state.PA}</p>
          <p>你已经修读的总学分{this.state.Credit}</p>
          <Button
              htmlType="button"
              onClick={this.studentDataResult.bind(this)}
          >生成报告</Button>
        </div>
    )
  }
}

const mapStateToProps = (state) =>{
  console.log(state);
  return{
    studentID: state.studentID,
    studentPassword: state.studentPassword,
    studentMajor: state.studentMajor,
  }
};
export default connect(mapStateToProps)(Feedback);
